import React from "react";
import Icon from "./icon";
import NavigationItem from "./navigation-item";

const items = {
  heading: <h5>Буюк Ипак Йўли Транс</h5>,
  addIcon: (
    <Icon
      typeIcon="fas fa-user-plus"
      toolTipText="Малумот Қўшиш"
      color="#06ab00"
    />
  ),
  printIcon: (
    <Icon typeIcon="fas fa-print" toolTipText="Печатлаш" color="#2499ff" />
  ),
  excelIcon: (
    <Icon
      typeIcon="fal fa-table"
      toolTipText="'Excel' да олиш"
      color="#ff9500"
    />
  ),
  statIcon: (
    <Icon
      typeIcon="fas fa-analytics"
      toolTipText="Статистика"
      color="#ff9500"
    />
  ),
  filterIcon: (
    <Icon typeIcon="fas fa-sort" toolTipText="Филтерлаш" color="#ff9500" />
  ),
  trashIcon: (
    <Icon
      typeIcon="fas fa-trash"
      toolTipText="Ўчирилган Малумотлар"
      color="#e30505"
    />
  ),
  searchInput: (
    <input type="text" placeholder="Излаш..." name="search" id="searchInput" />
  ),
};

function Header() {
  return (
    <nav className="navigation-bar">
      <ul className="navigation-list">
        <NavigationItem item={items.heading} />
        <NavigationItem item={items.addIcon} />
        <NavigationItem item={items.printIcon} />
        <NavigationItem item={items.excelIcon} />
        <NavigationItem item={items.statIcon} />
        <NavigationItem item={items.filterIcon} />
        <NavigationItem item={items.trashIcon} />
        <NavigationItem item={items.searchInput} />
      </ul>
    </nav>
  );
}

export default Header;
